import React from 'react';

function Footer() {

 
    return (
        <footer className="footer">
   
            <div className="footer__bloc" >
                
                <div className="footer__copyright"> © 2024 SOFT TRANSPORTS | 
                Mentions légales | 
                Conditions générales de vente</div>

            </div>

        </footer>
      
    );
}
  
export default Footer;
